import * as React from 'react';
import { useParams } from 'react-router-dom';
import { styled } from '@mui/material/styles';
import {Container, Box, Grid, Paper, Typography} from '@mui/material';

import Divider from '@mui/material/Divider';
import Stack from '@mui/material/Stack';
import Rating from '@mui/material/Rating';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

import Chip from '@mui/material/Chip';

const config = require('../config.json');

export default function RecipePage() {
  const {recipe_id} = useParams();

  const [recipeData, setRecipeData] = React.useState({});
  const [ingredientData, setIngredientData] = React.useState([]);

  React.useEffect(() => {
  fetch(`http://${config.server_host}:${config.server_port}/recipe/${recipe_id}`)
    .then(res => res.json())
    .then(resJson => setRecipeData(resJson))


  fetch(`http://${config.server_host}:${config.server_port}/recipe/${recipe_id}/ingredient`)
    .then(res => res.json())
    .then(resJson => setIngredientData(resJson))
  }, [recipe_id]);

  return (
      <Grid container spacing={2} display="flex" direction="row" alignItems="stretch">

        <Grid item xs={12}>
          <Paper sx={{ p: 2,}}>

            <Typography variant="h5" align="left" gutterBottom>
            {recipeData.name}
            </Typography>

            <Box sx={{width: 0, display: "flex", alignItems: "left"}}>
              <Rating name="read-only" value={Number(recipeData.avg_rating)} readOnly precision={0.5} align="left"/>
              <Box sx={{ ml: 1 }}>
                <Typography variant="body1" gutterBottom>
                  {recipeData.avg_rating}
                </Typography>
              </Box>
            </Box>



            <Typography variant="body2" align="left" gutterBottom>
            Submitted by {recipeData.user_id}
            </Typography> 

            <Typography variant="body1" align="left" gutterBottom>
            {recipeData.description}
            </Typography>

          </Paper>
        </Grid>


        <Grid item xs={12}>
          <Paper sx={{ p: 2,}}>
            <Stack direction="row" spacing={1}>
              {ingredientData.map((ingredient) =>
                <Chip label={ingredient.ingredient} />
              )}
            </Stack>
          </Paper>
        </Grid>

        <Grid item xs={12}>
          <TableContainer component={Paper}>
              <Table sx={{ minWidth: 650 }} aria-label="table">

                <TableHead>
                  <TableRow>
                    <TableCell align="right">Calories</TableCell>
                    <TableCell align="right">Total Fat</TableCell>
                    <TableCell align="right">Saturated Fat</TableCell>
                    <TableCell align="right">Protein</TableCell>
                    <TableCell align="right">Sugar</TableCell>
                    <TableCell align="right">Sodium</TableCell>
                  </TableRow>
                </TableHead>

                <TableBody>
                    <TableRow
                      key={recipeData.name}
                      sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                      <TableCell align="right">{recipeData.calories}</TableCell>
                      <TableCell align="right">{recipeData.total_fat}</TableCell>
                      <TableCell align="right">{recipeData.saturated_fat}</TableCell>
                      <TableCell align="right">{recipeData.protein}</TableCell>
                      <TableCell align="right">{recipeData.sugar}</TableCell>
                      <TableCell align="right">{recipeData.sodium}</TableCell>
                    </TableRow>
                </TableBody>
              </Table>
            </TableContainer>
        </Grid>

        <Grid item xs={4}>
          <Paper sx={{ p: 2,}}>

          </Paper>
        </Grid>

        <Grid item xs={4}>
          <Paper sx={{ p: 2,}}>
          </Paper>
        </Grid>


        <Grid item xs={4}>
          <Paper sx={{ p: 2,}}>

          </Paper>
        </Grid>


      </Grid>
  );
}
